import Vue from 'vue'
import Router from 'vue-router'
import itemDescription from './components/itemDescription'

Vue.use(Router)

export default new Router({
    mode: 'history',
    routes: [
        {
            path: '/item',
            name: 'itempage',
            componenet: itemDescription
        }
    ]
})
